import React from 'react';
import Linkedin from '../../assets/img/linkedin.png'

function LinkedIn() {
    <a href="https://www.linkedin.com/in/codeclast/" target="blank">
        <img src={linkedin} alt="find me on linkedin" />
    </a>
};

export default LinkedIn;
